import "./list.scss"
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { useEffect, useState } from "react";
import axios from 'axios';
import AutorenewOutlinedIcon from "@mui/icons-material/AutorenewOutlined";


const List = ({ onNotificationSent }) => {
  const [notifications, setNotifications] = useState([]);
  const [lastRefreshed, setLastRefreshed] = useState(null);

  useEffect(() => {
    fetchNotifications();
  }, []);

  const fetchNotifications = async () => {
    try {
      const response = await axios.get('http://localhost:8080/api/notifications/last');
      setNotifications(response.data);
      setLastRefreshed(new Date());
    } catch (error) {
      console.error('Error fetching notifications:', error);
    }
  };

  const handleRefresh = () => {
    fetchNotifications();
  };

  const handleSubmitNotification = () => {
    if (typeof onNotificationSent === "function") {
      onNotificationSent();
    }
  };

  return (
    <div>
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: "10px" }}>
        <div>
          <AutorenewOutlinedIcon onClick={handleRefresh} style={{ cursor: "pointer" }} />
          <span style={{ marginLeft: "10px", fontSize: "12px", fontStyle: "italic" }}>
            Last Refreshed: {lastRefreshed ? lastRefreshed.toLocaleString() : "Never"}
          </span>
        </div>
      </div>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell style={{ width: "10px" }}>ID</TableCell>
              <TableCell style={{ minWidth: 100 }}>CATEGORY</TableCell>
              <TableCell style={{ minWidth: 100 }}>MESSAGE</TableCell>
              <TableCell style={{ minWidth: 100 }}>STATUS</TableCell>
              <TableCell style={{ minWidth: 100 }}>START TIME</TableCell>
              <TableCell style={{ minWidth: 100 }}>END TIME</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {notifications.map((row) => (
              <TableRow
                key={row.id}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell component="th" scope="row">
                  {row.id}
                </TableCell>
                <TableCell>{row.category}</TableCell>
                <TableCell>{row.message}</TableCell>
                <TableCell>{row.status}</TableCell>
                <TableCell>{row.startTime}</TableCell>
                <TableCell>{row.endTime}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

export default List
